import React from "react";
import PageWrapper from "./components/layout/page-wrapper/page-wrapper";
import { GlobalStyle } from "./styles";

function App() {
  return (
    <>
      <GlobalStyle />
      <PageWrapper />
    </>
  );
}

export default App;
